import React from 'react';
import './LaunchingSoon.scss';
import { Parallax, ParallaxProvider } from 'react-scroll-parallax';

const LaunchingSoon = () => {
  return (
    <ParallaxProvider>
        <Parallax speed={-10}>
            <h1>
                MillionDollarPosters
            </h1>
        </Parallax>
    </ParallaxProvider>
  )
}

export default LaunchingSoon
